import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import styles from './StyleEditor.module.css';

const toolbarItems = [
  { id: 1, icon: 'üì∑', label: 'Camera' },
  { id: 2, icon: 'üé®', label: 'Style' },
  { id: 3, icon: 'üìè', label: 'Grid' },
  { id: 4, icon: 'üìê', label: 'Layout' },
  { id: 5, icon: 'üí∞', label: 'Price' },
  { id: 6, icon: '‚ùå', label: 'Remove' }
];

const profileImages = [
  { id: 1, image: '/assets1/ma.png' },
  { id: 2, image: '/assets1/Frame 1597881673.png' },
  { id: 3, image: '/assets1/Frame 1597881674.png' },
  { id: 4, image: '/assets1/Frame 1597881674 (1).png' },
  { id: 5, image: '/assets1/polo-style.png' }
];

const categories = [
  'Basic jumpers',
  'Warm puffer',
  'Bomber',
  'Biker jacket'
];

export default function StyleEditor() {
  const navigate = useNavigate();
  const [isFavorite, setIsFavorite] = useState(false);
  const [selectedProfile, setSelectedProfile] = useState(0);
  const [selectedCategory, setSelectedCategory] = useState(0);
  const [imageError, setImageError] = useState(false);

  const handleClose = () => {
    navigate(-1);
  };

  const toggleFavorite = () => {
    setIsFavorite(!isFavorite);
  };

  const handleToolClick = (tool) => {
    console.log('Tool clicked:', tool);
  };

  const handleImageError = () => {
    setImageError(true);
    console.error('Failed to load image');
  };

  return (
    <div className={styles.container}>
      {/* Header */}
      <div className={styles.header}>
        <button className={styles.closeButton} onClick={handleClose}>
          ‚úï
        </button>
        <div className={styles.sparkle}>‚ú®</div>
        <div className={styles.headerRight}>
          <button className={styles.iconButton}>üõí</button>
          <button 
            className={styles.iconButton}
            onClick={toggleFavorite}
          >
            {isFavorite ? '‚ù§Ô∏è' : 'ü§ç'}
          </button>
        </div>
      </div>

      {/* Main Content */}
      <div className={styles.mainContent}>
        <div className={styles.imageContainer}>
          {!imageError ? (
            <img 
              src={profileImages[selectedProfile].image}
              alt="Style preview"
              className={styles.mainImage}
              onError={handleImageError}
            />
          ) : (
            <div className={styles.errorMessage}>Image could not be loaded</div>
          )}
        </div>

        {/* Right Toolbar */}
        <div className={styles.rightToolbar}>
          <div className={styles.toolsLabel}>Tools</div>
          {toolbarItems.map((item) => (
            <button 
              key={item.id} 
              className={styles.toolButton}
              onClick={() => handleToolClick(item.label)}
            >
              <span className={styles.toolIcon}>{item.icon}</span>
            </button>
          ))}
        </div>

        {/* Profile Circles */}
        <div className={styles.profilesContainer}>
          {profileImages.map((profile, index) => (
            <button
              key={profile.id}
              className={`${styles.profileButton} ${selectedProfile === index ? styles.selectedProfile : ''}`}
              onClick={() => {
                setSelectedProfile(index);
                setImageError(false);
              }}
            >
              <img 
                src={profile.image} 
                alt={`Profile ${index + 1}`}
                className={styles.profileImage}
              />
            </button>
          ))}
        </div>

        {/* Categories */}
        <div className={styles.categoriesContainer}>
          {categories.map((category, index) => (
            <button
              key={index}
              className={`${styles.categoryButton} ${selectedCategory === index ? styles.selectedCategory : ''}`}
              onClick={() => setSelectedCategory(index)}
            >
              {category}
            </button>
          ))}
          <button 
            className={styles.searchButton}
            onClick={() => navigate('/clothing-catalog', { replace: true })}
          >
            üîç
          </button>
        </div>

        {/* Bottom Toolbar */}
        <div className={styles.bottomToolbar}>
          <button className={styles.toolbarButton}>
            <span className={styles.toolbarIcon}>üëî</span>
            <span className={styles.toolbarLabel}>Collar</span>
          </button>
          <button className={styles.toolbarButton}>
            <span className={styles.toolbarIcon}>üëï</span>
            <span className={styles.toolbarLabel}>Styles</span>
          </button>
          <button className={styles.toolbarButton}>
            <span className={styles.toolbarIcon}>üëñ</span>
            <span className={styles.toolbarLabel}>Pant</span>
          </button>
          <button className={styles.toolbarButton}>
            <span className={styles.toolbarIcon}>üß•</span>
            <span className={styles.toolbarLabel}>Coat</span>
          </button>
          <button className={styles.toolbarButton}>
            <span className={styles.toolbarIcon}>üëú</span>
            <span className={styles.toolbarLabel}>Accessories</span>
          </button>
          <button className={styles.toolbarButton}>
            <span className={styles.toolbarIcon}>üîß</span>
            <span className={styles.toolbarLabel}>Tools</span>
          </button>
        </div>
      </div>
    </div>
  );
}
